import React, { Component } from 'react'
import { Link } from 'react-router-dom'

import { Collapse, Navbar, NavbarToggler, NavbarBrand, Nav, NavItem, NavLink } from 'reactstrap';
import { withRouter } from "react-router";

class Footer extends Component {
	render(){ 
		return (<div id="footer">
			<p>This site is in no way affiliated with any of the companies or brands listed.</p>
			<p>Information provided by the <a href="https://data.lcb.wa.gov/" target="_blank">Washington State Liquor and Cannabis Control Board</a> API and is only as up-to-date as the provided date.</p>
			<p>Made with; <a href="https://reactjs.org/" target="_blank">React</a>, <a href="https://redux.js.org/" target="_blank">Redux</a>, <a href="https://reacttraining.com/react-router/" target="_blank">React Router</a>, <a href="https://reactstrap.github.io/" target="_blank">reactstrap</a>, <a href="https://sass-lang.com/" target="_blank">SASS</a>, and hosted on <a href="# put repo link here">GitHub</a></p>
		</div>)
	}
}

export default Footer;
